I would be great to relax the "key-spacing" rule by allowing to use type aligned AND the non-aligned style per group. Currently every group must be either aligned or not and it would be helpful to only have each group to be either aligned or not.

Example (`"key-spacing": [2, {"align": "value", "beforeColon": false,"afterColon": true}]`):
```
var obj1 = {
	prop: 'value',
	p:    'value'
};

var obj2 = {
	prop: 'value',
	p: 'value'
};

8:4  error  Missing space before value for key "p"  key-spacing
```

A possible way to configure this would be to have an additional option "align-optional" that has the same functionality as currently align has but is only only considered per group.


